import { Component, EventEmitter, Input, OnInit, Output, Inject } from '@angular/core';
import { asEnumerable } from 'linq-es2015';
import { ActivatedRoute, Router } from "@angular/router";
import { RolesService } from '@modules/seguridad/services/roles.service';
import { ListarUsuarioDto, UsuarioDto } from '@core/models/seguridad/UsuarioDto';
import { BootstrapNotifyBarService } from "@shared/services/bootstrap-notify.service";
@Component({
  selector: 'app-editar-roles',
  templateUrl: './editar-roles.component.html',
  styleUrls: [
  ]
})

export class EditarRolesComponent implements OnInit {
  requestUsuario: any;
  constructor(
    private rolesService: RolesService,
    public router: Router,
    private route: ActivatedRoute,
    private bootstrapNotifyBarService: BootstrapNotifyBarService
  ) {
  }
  async ngOnInit() {    
    let valor: any = this.route.snapshot.paramMap.get('id');   
    this.rolesService.obtenerRolesPorId(parseInt(valor)).subscribe((data: any) => {
      this.requestUsuario=data;      
    });
  }
  crear(sol: any) {
    this.rolesService.actualizarRoles(sol)
      .subscribe((data: any) => {
        if(data.tipoResultado==1){
          this.bootstrapNotifyBarService.notifySuccess(data.mensaje);
          setTimeout(() => {
            this.router.navigate(['/seguridad', 'bandroles'])
          }, 3000)
        }else{
          this.bootstrapNotifyBarService.notifyWarning(data.mensaje);
        }      
      });
  }
}
